[Web Young] Ariana Marie, Kota Skye [Sprint and Soak] [1080p](July 24, 2015) [.mp4]

It's time for girls Ariana Marie and Kota Sky to get back into shape. They tie up their shoes and hit the trails. Ariana encourages Kota saying she's doing a great job and in no time, she will be looking like a million bucks. Kota was in dire need to take a shower where Arianna mentions she has a hot tub at her place. The perfect atmosphere to relax after a hard days workout. 

